INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "獣人族", "人助けが大好き！　前向き格闘娘", "トゥインクルウィッシュ", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 16, 100101, 2, "東山奈央", "A", 27, "人助け、応援", 0, "ヒヨリ", 155, 44);
