INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (1, "魔族", "クールで何事にも真っ直ぐな剣士", "トゥインクルウィッシュ", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 18, 100301, 2, "早見沙織", "B", 12, "読書、乗馬、お茶", 0, "レイ", 163, 46);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "ヒューマン", "探検好きのイタズラっ子", "リトルリリカル", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 9, 100401, 5, "諸星すみれ", "O", 10, "いたずら、探検", 0, "ミソギ", 128, 27);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (11, "獣人族", "ヒーローに憧れる騎士見習いの少女", "王宮騎士団（NIGHTMARE）", "？？？", 12, 100501, 8, "下田麻美", "O", 25, "ヒーローごっこ", 0, "マツリ", 146, 40);
