INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (1, "魔族", "プリン大好きゴースト娘", "悪魔偽王国軍（ディアボロス）", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 14, 100701, 7, "雨宮天", "B", 23, "プリンを食べること", 0, "ミヤコ", 130, 32);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "エルフ", "ボクは誰よりも美しい", "ヴァイスフリューゲル　ランドソル支部", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 14, 100801, 15, "大空直美", "AB", 10, "鏡で自分を見ること", 0, "ユキ", 150, 40);
