INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (9, "獣人族", "マホマホ王国のプリンセス", "自警団（カォン）", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 16, 101001, 10, "内田真礼", "O", 22, "空想、ぬいぐるみ集め", 0, "マホ", 155, 42);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "ヒューマン", "人懐っこくてマシンガントークな妹系少女", "ラビリンス", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 15, 101101, 3, "阿澄佳奈", "A", 25, "お裁縫", 0, "リノ", 156, 44);
