INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "魔族", "天真爛漫で人気者のカリスマモデル", "ルーセント学院", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 17, 101601, 14, "上坂すみれ", "O", 10, "ファッション", 0, "スズナ", 167, 48);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "獣人族", "いつでも「なんくるないさ～」な天然娘", "自警団（カォン）", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 17, 101701, 10, "高森奈津美", "A", 7, "踊り、空手", 0, "カオリ", 158, 53);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (8, "魔族", "多くの男性を魅了する無垢な女教師", "ルーセント学院", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 23, 101801, 14, "伊藤静", "B", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 0, "イオ", 162, 52);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (4, "獣人族", "お歌もにんじんも、ウサギさんも大好き♪", "リトルリリカル", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 10, 102001, 5, "日高里菜", "O", 3, "かわいいもの集め", 0, "ミミ", 117, 21);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (6, "ヒューマン", "泣き虫で臆病な守ってあげたい女の子", "サレンディア救護院", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 12, 102101, 9, "植田佳奈", "B", 9, "観劇、おままごと", 0, "クルミ", 150, 40);
