INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (12, "ヒューマン", "お嬢さまのためにがんばるドジっ娘メイド", "サレンディア救護院", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 15, 102501, 9, "悠木碧", "O", 12, "ご奉仕", 0, "スズメ", 154, 43);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (1, "獣人族", "遊びと睡眠が何より大事なぐうたら娘", "牧場（エリザベスパーク）", "test", 17, 102601, 11, "小岩井ことり", "B", 1, "あんパン", 0, "リン", 144, 42);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (7, "魔族", "運命の相手に一途すぎる乙女", "トワイライトキャラバン", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 16, 102701, 13, "橋本ちなみ", "B", 30, "実験、裁縫、料理", 0, "エリコ", 154, 43);
INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "エルフ", "救護院を経営する優しい庶民派お嬢様", "サレンディア救護院", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 17, 102801, 9, "堀江由衣", "A", 4, "経営、お茶会", 0, "サレン", 156, 43);
