INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (5, "魔族", "かつては夜を支配した最強の吸血鬼", "悪魔偽王国軍（ディアボロス）", "test", "??", 104401, 7, "丹下桜", "A", 5, "世界征服", 0, "イリヤ", 172, 50);
