INSERT INTO `v1_9400bd9dcc7ebc688709f84aac51a3d347c6aa967eebfff9964065f27d5e1785` VALUES (10, "ヒューマン", "素顔を見せない冷静沈着な女性騎士", "王宮騎士団（NIGHTMARE）", "？？？", 25, 104701, 8, "川澄綾子", "A", 25, "格闘技、湯浴み", 0, "ジュン", 171, 50);
